import React from 'react';
import Carousel from 'react-bootstrap/Carousel';
import Image from 'react-bootstrap/Image';
import { Parallax, ParallaxBanner } from 'react-scroll-parallax';



function MainSlider() {
  return (
      <div className="slider">
        <Carousel
        >
          <Carousel.Item>
          <Parallax
                offsetYMin={0}
                offsetYMax={0}
                className="slide_img"
            >
            <Image src="/images/slides/slide_2.png" />
            </Parallax>
          </Carousel.Item>


          <Carousel.Item>
          <Parallax
                offsetYMin={-100}
                offsetYMax={100}
                className="slide_img"
            >
            <img src="/images/slides/slide_2.png" />
            </Parallax>
          </Carousel.Item>


          <Carousel.Item>
          <Parallax
                offsetYMin={-100}
                offsetYMax={100}
                className="slide_img"
            >
            <img src="/images/slides/slide_2.png" />
            </Parallax>
          </Carousel.Item>
        </Carousel>
      </div>
  );
}

export default MainSlider;
